import React, { useState, useEffect } from "react";
import {
  View,
  Text,
  Pressable,
  Image,
  TextInput,
  Modal,
  ScrollView,
  StyleSheet,
} from "react-native";
import { Ionicons } from "@expo/vector-icons";

const listFriend = ["Boo", "Anh Yêu", "Trần Thị Yến Nhi", "Lê Ngọc Hân"];

const FriendDirectory = ({ navigation }) => {
  const [friend, setFriend] = useState("");

  return (
    <ScrollView style={styles.container}>
      <View style={styles.section}>
        <Pressable style={styles.item}>
          <Ionicons name="people-circle-sharp" size={40} color="#0091FF" />
          <Text style={styles.itemText}>Lời mời kết bạn</Text>
        </Pressable>
        <Pressable style={styles.item}>
          <Image
            style={styles.iconImage}
            source={require("/assets/contacts.png")}
          />
          <Text style={styles.itemText}>Danh bạ máy</Text>
        </Pressable>
        <Pressable style={styles.item}>
          <Image
            style={styles.iconImage}
            source={require("/assets/cake.png")}
          />
          <Text style={styles.itemText}>Lịch sinh nhật</Text>
        </Pressable>
      </View>
      <View style={styles.section}>
        <View style={styles.buttons}>
          <Pressable style={[styles.button, styles.activeButton]}>
            <Text style={styles.buttonText}>Tất cả 470</Text>
          </Pressable>
          <Pressable style={styles.button}>
            <Text style={styles.buttonText}>Mới truy cập 71</Text>
          </Pressable>
        </View>
      </View>
      <View style={styles.section}>
        <View style={styles.titleBar}>
          <Ionicons name="star" size={25} color="#FCC914" />
          <Text style={styles.title}>Bạn thân</Text>
          <Pressable>
            <Text style={styles.link}>+ Thêm</Text>
          </Pressable>
        </View>
        {listFriend.map((friend, index) => (
          <View key={index} style={styles.friendItem}>
            <Image
              style={styles.avatar}
              source={require("/assets/meomeo.jpg")}
            />
            <Text style={styles.friendName}>{friend}</Text>
            <View style={styles.iconGroup}>
              <Ionicons name="call-outline" size={25} color="black" />
              <Ionicons name="videocam-outline" size={25} color="black" />
            </View>
          </View>
        ))}
      </View>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#7B8594",
    paddingVertical: 20,
    paddingHorizontal: 10,
  },
  section: {
    marginBottom: 20,
  },
  item: {
    flexDirection: "row",
    alignItems: "center",
    backgroundColor: "white",
    padding: 10,
    borderRadius: 5,
    marginBottom: 10,
  },
  itemText: {
    marginLeft: 10,
    fontWeight: "bold",
    fontSize: 16,
  },
  iconImage: {
    width: 30,
    height: 30,
  },
  buttons: {
    flexDirection: "row",
    justifyContent: "space-between",
    marginBottom: 10,
  },
  button: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "white",
    padding: 10,
    borderRadius: 5,
    borderWidth: 1,
    borderColor: "#C7D2DE",
    marginRight: 10,
  },
  activeButton: {
    backgroundColor: "#A1CDF1",
  },
  buttonText: {
    fontWeight: "bold",
    fontSize: 16,
  },
  titleBar: {
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
    marginBottom: 10,
  },
  title: {
    fontWeight: "bold",
    fontSize: 18,
  },
  link: {
    color: "#0091FF",
    fontWeight: "bold",
    fontSize: 16,
  },
  friendItem: {
    flexDirection: "row",
    alignItems: "center",
    backgroundColor: "white",
    padding: 10,
    borderRadius: 5,
    marginBottom: 10,
  },
  avatar: {
    width: 50,
    height: 50,
    borderRadius: 25,
    marginRight: 10,
  },
  friendName: {
    fontWeight: "bold",
    fontSize: 16,
    flex: 1,
  },
  iconGroup: {
    flexDirection: "row",
    alignItems: "center",
  },
});

export default FriendDirectory;
